import { Container, Typography } from "@mui/material";
import React from "react";

const AddPostPage = () => {
  return (
    <Container sx={{ padding: 5 }} maxWidth="xs">
      <Typography sx={{ fontSize: 20 }}>Add Post</Typography>
    </Container>
  );
};

export default AddPostPage;
